import "./share.css";

const Share = () => {
  return (
    <div className="shareContainer">
      <div className="shareWrapper">
              <div className="shareTop">
                  <img src="" alt="" className="shareProfilePicture" />
        </div>
        <div className="shareBottom"></div>
      </div>
    </div>
  );
};

export default Share;
